export default function HomePage() {
    return (
        <>
           <Hero title = "Reactjs by Waleoxy" max="true" img = {mainBcg}>
            <Link to="/works" color="var(--mainGrey)" font-size="19rem">my works</Link>
           </Hero>
        </>
    )
}
